import React from "react";
import './App.css'

function Navbar() {
    return (
    <header class="header">
    <div class="navbar">
        <div class="logo">
            <a href="" class="img">LOGO</a>
        </div>
            <ul class="navlist">
                <li><a href="index.html" class="navitem">Home</a></li>
                <li><a href="#" class="navitem">Shop</a></li>
                <li><a href="aboutus.html" class="navitem">Chi siamo</a></li>
                <li><a href="#" class="navitem">Contatti</a></li>
            </ul>
    </div>
    <div class="hamburger">
        <span class="bar"></span>
        <span class="bar"></span>
        <span class="bar"></span>
    </div>
</header>
    );

    const hamburger = document.querySelector(".hamburger");
    const navlist = document.querySelector(".navlist");
    hamburger.addEventListener("click", () =>{
        hamburger.classList.toggle("active");
        navlist.classList.toggle("active");
})

}
  
export default Navbar;
